import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        primary: {
            main: '#B0E0E6',
        },
        secondary: {
            main: '#f50057',
        },
        background: {
            default: '#B0E0E6',
        },
    },
    typography: {
        fontFamily: '"Inter", "Arial", sans-serif',
      },

});

export default theme;
